export const logEvent = (message, data = {}) => {
  const logEntry = {
    timestamp: new Date().toISOString(),
    message,
    ...data,
  };
  const existingLogs = JSON.parse(localStorage.getItem("logs")) || [];
  existingLogs.push(logEntry);
  localStorage.setItem("logs", JSON.stringify(existingLogs));
};
